import React from 'react';

const Skills = () => (
  <section className="skills">
    <h2>Skills</h2>
    <ul>
      <li>Python</li>
      <li>Java</li>
      <li>C++</li>
      <li>Docker</li>
      <li>GitHub</li>
      <li>JUnit</li>
    </ul>
  </section>
);

export default Skills;
